import React,{Component} from 'react';
import { Link } from 'react-router-dom';
class User extends Component{
    render(){
        return(
            <>
              <h1>用户中心</h1>
              <ul>
                  <li>
                      <Link to="/user/reg">注册</Link>
                  </li>
                  <li>
                      <Link to="/user/login">登录</Link>
                  </li>
              </ul>
              《
            </>
        )
    }
}
export default User;
